// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import {TokenRecipient} from './TokenRecipient.sol';
import {OwnedUpgradeabilityStorage} from './OwnedUpgradeabilityStorage.sol';
import {OwnedUpgradeabilityProxy} from './OwnedUpgradeabilityProxy.sol';
import {ProxyRegistry} from './ProxyRegistry.sol';
import {OwnableDelegateProxy} from './OwnableDelegateProxy.sol';
import {DataType} from './libraries/DataType.sol';
import {IAuthenticatedProxy} from './interfaces/IAuthenticatedProxy.sol';

contract AuthenticatedProxy is TokenRecipient, OwnedUpgradeabilityStorage, IAuthenticatedProxy {

    /* Whether initialized. */
    bool initialized = false;

    /* Address which owns this proxy. */
    address public user;

    /* Associated registry with contract authentication information. */
    ProxyRegistry public registry;

    /* Whether access has been revoked. */
    bool public revoked;

    string public constant version = "1.0";

    /* Delegate call could be used to atomically transfer multiple assets owned by the proxy contract with one order. */
    // enum HowToCall { Call, DelegateCall }

    /* Event fired when the proxy access is revoked or unrevoked. */
    event Revoked(bool revoked);

    /**
     * Initialize an AuthenticatedProxy
     *
     * @param addrUser Address of user on whose behalf this proxy will act
     * @param addrRegistry Address of ProxyRegistry contract which will manage this proxy
     */
    function initialize (address addrUser, ProxyRegistry addrRegistry)
        public
    {
        require(!initialized);
        initialized = true;
        user = addrUser;
        registry = addrRegistry;
    }

    /**
     * Set the revoked flag (allows a user to revoke ProxyRegistry access)
     *
     * @dev Can be called by the user only
     * @param revoke Whether or not to revoke access
     */
    function setRevoke(bool revoke)
        public
    {
        require(msg.sender == user);
        revoked = revoke;
        emit Revoked(revoke);
    }

    /**
     * Execute a message call from the proxy contract
     *
     * @dev Can be called by the user, or by a contract authorized by the registry as long as the user has not revoked access
     * @param dest Address to which the call will be sent
     * @param howToCall Which kind of call to make
     * @param data Calldata to send
     * @return result Result of the call (success or failure)
     */
    function proxy(address dest, DataType.HowToCall howToCall, bytes calldata data)
        public
        override
        returns (bool result)
    {
        require(msg.sender == user || (!revoked && registry.contracts(msg.sender)), "!valid proxy sender");
        if (howToCall == DataType.HowToCall.Call) {
            (result,) = dest.call(data);
        } else if (howToCall == DataType.HowToCall.DelegateCall) {
            (result,) = dest.delegatecall(data);
        }
        return result;
    }

    /**
     * Execute a message call and assert success
     * 
     * @dev Same functionality as `proxy`, just asserts the return value
     * @param dest Address to which the call will be sent
     * @param howToCall What kind of call to make
     * @param data Calldata to send
     */
    function proxyAssert(address dest, DataType.HowToCall howToCall, bytes calldata data)
        public
        override
    {
        require(proxy(dest, howToCall, data));
    }

}

